import {fetchChargers} from "../services/charger/fetchChargersService";

/**
 * @author Magnus
 * @version 06/08/2021
 * Dispatches actions to mapReducer.
 * GetAllChargers
 */

export const ACTION_TYPES = {
    FETCH_CHARGERS_PENDING: 'FETCH_CHARGERS_PENDING',
    FETCH_CHARGER_SUCCESS: 'FETCH_CHARGER_SUCCESS',
    FETCH_CHARGERS_FAILURE: 'FETCH_CHARGERS_FAILURE'
};

/**
 * Async method
 * Fetches all chargers and dispatches actions
 * in accord with response/error.
 * @return function
 */
export const getAllChargers = () => {
    return async (dispatch) => {
        dispatch({type: ACTION_TYPES.FETCH_CHARGERS_PENDING, payload: null});
        fetchChargers().then(response => {
            dispatch({type: ACTION_TYPES.FETCH_CHARGER_SUCCESS, payload: response.data});
        }).catch(error => {
            dispatch({type: ACTION_TYPES.FETCH_CHARGERS_FAILURE, payload: error});
        });
    };
};
